import { Router,Routes,Route} from "react-router-dom"
import {BrowserRouter} from 'react-router-dom';
import './App.css';
import Home from "./components/Home";
function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" component={Home}>
           </Route>
        </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
